import { backendAPI } from '@instinct-web/core';
export class BusinessServiceImplementation {
  async create(businessDTO) {
    const newBusiness = await backendAPI.post('businesses', businessDTO);
    return newBusiness.data;
  }

  async getAll() {
    const businesses = await backendAPI.get('businesses');
    return businesses.data;
  }

  async getByID(businessID) {
    const business = await backendAPI.get(`businesses/${businessID}`);
    return business.data;
  }

  async delete(businessID) {
    await backendAPI.delete(`businesses/${businessID}`);
  }

}
